import React from "react";
import "../fontello-28e9e4e9/css/fontello.css";

export default function SocialBar() {
  return (
    <div className="social-icons">
      <i className="facebook-(2)" style={{ fontSize: "80px" }} />

      <a>
        <span className="facebook-(2)"></span>
      </a>
    </div>
  );
}
